import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

const About = () => {
  const [ref, inView] = useInView({
    threshold: 0.3,
    triggerOnce: true
  });

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.6
      }
    }
  };


  // Experience steps in desired order
  const experienceSteps = [
    {
      title: 'MyOpini, Frontend Developer - Intern',
      sub: 'April 2025 – Present',
      desc: 'Leading frontend development, implementing complex designs, optimizing performance, integrating smart contracts, and mentoring an intern for scalable, high-quality project delivery.'
    },
    {
      title: 'Dev3Pack Fellow',
      sub: 'June 2025 – Present',
      desc: 'Selected for a web3 builder fellowship, collaborating on decentralized projects with developers from web2 backgrounds.'
    },
    {
      title: 'SheFi Scholar',
      sub: 'Feb 2025 – April 2025',
      desc: 'Awarded a scholarship to join a global women-led Web3 cohort, engaging in hands-on DeFi and blockchain learning.'
    }
  ];

  return (
    <section id="about" className="about">
      <div className="container">
        <motion.h2 
          className="section-title"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          About
        </motion.h2>

        <motion.div 
          className="content-grid irregular"
          ref={ref}
          variants={containerVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
        >
          <motion.div className="content-block" variants={itemVariants}>
            <span className="hashtag">#about #developer</span>
            <h3 className="content-block-title">about me</h3>
            <p className="content-block-text">
              I'm an AI and Data Science engineering student exploring how Web3, AI, and creativity can 
              come together to build useful, meaningful things. I enjoy working on projects that 
              solve real problems at the intersection of AI and Web3.
            </p>
            <p className="content-block-text" style={{ marginTop: '1rem' }}>
              Outside of building, I like experimenting with new Web3 tools and protocols, 
              and being part of communities that support and teach each other in the decentralized space. 
              I'm still figuring things out, but I'm here to grow, stay curious, and keep building the future of the web.
            </p>
          </motion.div>
          <motion.div className="content-block" variants={itemVariants}>
            <h3 className="content-block-title">education</h3>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
              {[{
                title: 'B.E in Artificial Intelligence and Data Science',
                sub: 'VESIT, Mumbai – 2022 – 2026'
              }, {
                title: 'HSC Science',
                sub: 'Kendriya Vidyalaya, Nashik – Completed in 2022'
              }, {
                title: 'SSC Science',
                sub: 'Kendriya Vidyalaya, Nashik – Completed in 2020'
              }].map((step, idx) => (
                <div key={idx} style={{
                  padding: '0.8rem',
                  background: 'var(--darker-gray)',
                  border: '1px solid var(--border-color)',
                  borderRadius: '8px',
                }}>
                  <div style={{ fontWeight: 700, fontSize: '0.9rem', color: 'var(--off-white)', marginBottom: '0.3rem' }}>{step.title}</div>
                  <div style={{ fontSize: '0.85rem', color: 'var(--text-gray)' }}>{step.sub}</div>
                </div>
              ))}
            </div>
          </motion.div>

          <motion.div className="content-block" variants={itemVariants}>
            <h3 className="content-block-title">experience</h3>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
              {experienceSteps.map((step, idx) => (
                <div key={idx} style={{
                  padding: '0.8rem',
                  background: 'var(--darker-gray)',
                  border: '1px solid var(--border-color)',
                  borderRadius: '8px',
                }}>
                  <div style={{ fontWeight: 700, fontSize: '0.9rem', color: 'var(--off-white)', marginBottom: '0.3rem' }}>{step.title}</div>
                  <div style={{ fontSize: '0.85rem', color: 'var(--text-gray)', marginBottom: '0.3rem' }}>{step.sub}</div>
                  <div style={{ fontSize: '0.85rem', color: 'var(--text-gray)' }}>{step.desc}</div>
                </div>
              ))}
            </div>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
